import React, { useState } from "react";

export const Closed_Toggler_Button = () => {

    const [toggle, updateToggle] = useState('on')

    const Switch = (status) => {

        switch(status){

        case('on'): return <span id='Closed_Toggler_Button' onClick={()=>{updateToggle('off')}}>
        Open Filter 
        </span>

        case('off'):return <span id='Closed_Toggler_Button' onClick={()=>{updateToggle('on')}}>
        Close Filter 
        </span>

        }}

        return Switch(toggle);

}

export default Closed_Toggler_Button;
